import React, { Component } from 'react'
import TopMenu from '../components/TopMenu'
import { connect } from 'react-redux'
import { getAllPagesAction } from '../actions'
import PageCart from '../components/PageCart'

class Home extends Component {
    componentDidMount() {
        this.props.getpages()
    }
    render() {
        return (<>
            <TopMenu />
            <div>
                <h1 style={{ fontSize: 30, }}>All Pages</h1>
                <div className="pagecarts">
                    {this.props.allpages ?
                        Object.keys(this.props.allpages).map(el => <PageCart key={this.props.allpages[el]._id} name={this.props.allpages[el].name} connected={this.props.allpages[el].isConnected} page={this.props.allpages[el]} />) :
                        <h1>loading</h1>
                    }
                </div>
            </div>
        </>
        )
    }

}

const mapStateToProps = (state) => ({
    allpages: state.allpages
})

const mapDispatchToProps = (dispatch) => {
    return {
        getpages: () => dispatch(getAllPagesAction())
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(Home)
